import React from 'react';
import { Button, Form } from 'semantic-ui-react';

const ContactForm = () => (
    <Form success>
        <Form.Input label='Email' placeholder='example@gmail.com' />
        <Message
            success 
            header='Form Completed' 
            content="You'll hear back from me soon!"
        />
        <Button>Submit</Button>
    </Form>
)

export default ContactForm;
